function __spreadArrays() {
    for (var s = 0, i = 0, il = arguments.length; i < il; i++) s += arguments[i].length;
    for (var r = Array(s), k = 0, i = 0; i < il; i++)
        for (var a = arguments[i], j = 0, jl = a.length; j < jl; j++, k++)
            r[k] = a[j];
    return r;
}

moment.prototype.subtract = function (subtract) {
    return function (amount, unit) {
        if (this._is29Day) {
            this.add(1, 'd');
        }
        var cloneThis = moment(this);
        var result = subtract.call(this, amount, unit);
        if (this._is29Day) {
            return result;
        }
        // 需要去除掉的日期列表
        var removeDays = [
            '0000-02-29',
            '-0004-02-29',
            '-0012-02-29',
            '-0016-02-29',
            '-0024-02-29',
            '-0028-02-29',
            '-0036-02-29',
            '-0040-02-29',
        ];
        for (var i in removeDays) {
            var isBetween = moment(removeDays[i]).isBetween(result, cloneThis, 'd', '[]');
            if (isBetween) {
                return subtract.call(result, 1, 'd');
            }
        }
        // 儒略历在前 45 年和前 9 年每三年一闰，以下是儒略历中是闰年，但在格里高利历（公历）不是闰年的年份列表
        var leapYearList = [
            '-0011-02-28',
            '-0014-02-28',
            '-0017-02-28',
            '-0023-02-28',
            '-0026-02-28',
            '-0029-02-28',
            '-0035-02-28',
            '-0038-02-28',
            '-0041-02-28',
        ];
        if (leapYearList.includes(result.format('YYYY-MM-DD'))) {
            result._is29Day = true;
            return result;
        }
        for (var i in leapYearList) {
            var isBetween = moment(leapYearList[i]).isBetween(result, cloneThis, 'd');
            if (isBetween) {
                return result.add(1, 'd');
            }
        }
        return result;
    };
}(moment.prototype.subtract);
// 获取公元前的年数，需要减去 1
moment.prototype.year = function (year) {
    return function (y) {
        var thisYear = year.bind(this);
        if (y) {
            return thisYear(y);
        }
        var result = thisYear();
        if (result > 0) {
            return result;
        }
        return result - 1;
    };
}(moment.prototype.year);
// 获取公元前的年数，需要减去 1
moment.prototype.day = function (day) {
    return function (d) {
        var thisDay = day.bind(this);
        if (d) {
            return thisDay(d);
        }
        var result = thisDay();
        if (this._is29Day && result === 28) {
            return 29;
        }
        return result;
    };
}(moment.prototype.day);

